import React from 'react'
import { Row, Col, Breadcrumb, BreadcrumbItem} from 'reactstrap'
import {Rating} from 'primereact/rating';
import DisplayImage from './DisplayObjectImage';
import ObjectDescription from './ObjectDescription';
import OjbectPrice from './ObjectPrice';

const objectPage = ( props ) => {
    const boxStyle = {
        padding: '3%',
    };

    return(
        <div>
            <Row>
                <Col xs={5}>
                    <div style={boxStyle}>
                        <Breadcrumb>
                            <BreadcrumbItem><a href="http://localhost:3000/">Home</a></BreadcrumbItem>
                            <BreadcrumbItem active>The Amazing Sloth</BreadcrumbItem>
                        </Breadcrumb>
                        <DisplayImage img={ props.img }/>
                    </div>
                </Col>
                <Col style={boxStyle}>
                    <ObjectDescription />
                </Col>
                <Col style={boxStyle}>
                    <OjbectPrice />
                </Col>
            </Row>
            <Row>
                <Rating value={this.state.value} onChange={(e) => this.setState({value: e.value})} stars={5} />
            </Row>
        </div>
    )
};

export default objectPage;
